works well

if you're normal, that's chill, stop reading. if you're a weirdo:
I used this 99% on windows with like 20 hour uptime, but also tried on 2 androids and a chromebook dualbooted with ubuntu (and ChromeOS, duh) and they all seemed to work (ubuntu chromebook needed audio drivers anyways, and I didnt need to install usb-dongle-specific ones I just ran an SH script i found on github). i dont know if this thing needs or has drivers that'd be worth testing on other operating systems, i dont know enough about that stuff, but I don't see why it wouldn't work on an iPhone or a smart TV or whatever.
